<template>
  <svg
    viewBox="0 0 575 531"
    fill="none"
    xmlns="http://www.w3.org/2000/svg"
    xmlns:xlink="http://www.w3.org/1999/xlink"
  >
    <rect width="575" height="531" fill="url(#pattern0)" />
    <defs>
      <pattern
        id="pattern0"
        patternContentUnits="objectBoundingBox"
        width="1"
        height="1"
      >
        <use
          xlink:href="#image0_2_15"
          transform="translate(-0.000557907) scale(0.00102155 0.00110619)"
        />
      </pattern>
      <image
        id="image0_2_15"
        width="980"
        height="904"
        xlink:href="data:image/png;base64,"
      />
    </defs>
  </svg>
  <div class="square first"></div>
  <div class="square second"></div>
</template>

<style lang="scss" scoped>
svg {
  position: relative;
  z-index: 2;
  width: 100%;
}
.first {
  height: 41%;
  width: 50%;
  top: 0;
  right: 1530px;
}
.second {
  height: 44%;
  width: 61%;
  bottom: 0;
  left: -900px;
}
.square {
  background: rgba(255, 0, 184, 0.75);
  opacity: 0.5;
  filter: blur(1px);
  position: absolute;
  z-index: 1;
}
.righ {
  transition-duration: 1.5s;
  transition-property: right;
}
.right {
  transition-duration: 1.5s;
  transition-property: left;
}
</style>

<script lang="ts">
import { defineComponent } from "vue";
export default defineComponent({
  mounted() {
    const firstSquare = document.querySelector(".first") as HTMLElement;
    const secondSquare = document.querySelector(".second") as HTMLElement;
    firstSquare.className += " righ";
    secondSquare.className += " right";
    setTimeout(() => {
      firstSquare.style.right = "0px";
      secondSquare.style.left = "0px";
    }, 0);
  },
});
</script>
